import { Component } from '@angular/core';

@Component({
  selector: 'app-cinema',
  templateUrl: './cinema.component.html',
  styleUrls: ['./cinema.component.css']
})
export class CinemaComponent {

  getCinema(): void{
    this.contentService.getCinema().subscribe({
      next: (data) => {
        console.log(data);
        this.cinema = data;
      },
      error: (e) =>{
        console.log(e);
      }
    })
  }

}
